import React from 'react'
import Buttontabs from '../../../Components/Tabs/Buttontabs'
import './events_1.css'
import { Row, Col, } from 'react-bootstrap';

function Events_1() {
    return (
      <div className='Events_first_1'>
        <Row>
          <Col>
          <h1 style={{color:"white", fontWeight:"bold",padding:"10px"}}> Create Your Event </h1>
          </Col>
        </Row>
        
          <Buttontabs/>
      </div>
    );
  }
  
  export default Events_1;
